import React from "react";

function Review() {
  return (
    <div className="flex p-5 gap-10">
      <div className="relative w-1/2 flex flex-col bg-black rounded-md">
        <div className="code">Hello</div>
        <div className="absolute b-[1rem] right-[1rem]  ">
          <button className="text-white bg-blue-400 p-2">Review</button>
        </div>
      </div>
      <div className="w-1/2 flex flex-col gap-10 bg-[#343434] rounded-md"></div>
    </div>
  );
}

export default Review;
